                            data.TransactionType != "Credit" &&
                            <h1>Debit</h1>
                        }

                        {/* <td style = {this.tableStyle}>{ (data.TransactionType == Credit) &&
                               console.log({data.Amount})
                           }</td> */}
                    </tr>) : null
            }

            </div>
        )
    }
}

export default AxiosData
